import React from 'react';
import ReactDOM from 'react-dom';
import {VictoryChart, VictoryAxis, VictoryStack, VictoryBar, VictoryTheme} from 'victory';

const data2012 = [
    {quarter: 1, earnings: 13000, i: 100},
    {quarter: 2, earnings: 16500, i: 200},
    {quarter: 3, earnings: 14250, i: 300},
    {quarter: 4, earnings: 19000, i: 400}
  ];

  const data2013 = [
    {quarter: 1, earnings: 15000},
    {quarter: 2, earnings: 12500},
    {quarter: 3, earnings: 19500},
    {quarter: 4, earnings: 13000}
  ];

  const data2014 = [
    {quarter: 1, earnings: 11500},
    {quarter: 2, earnings: 13250},
    {quarter: 3, earnings: 20000},
    {quarter: 4, earnings: 15500}
  ];

  const data2015 = [
    {quarter: 1, earnings: 18000},
    {quarter: 2, earnings: 13250},
    {quarter: 3, earnings: 15000},
    {quarter: 4, earnings: 12000}
  ];

  class Test extends React.Component {
    render() {
      return (
        <VictoryChart
          domainPadding={20}
          theme={VictoryTheme.material}
        >
          <VictoryAxis
            tickValues={[1, 2, 3, 4]}
            tickFormat={["Quarter 1", "Quarter 2", "Quarter 3", "Quarter 4"]}
          />
          <VictoryAxis
            dependentAxis
            tickFormat={(x) => (`$${x / 1000}k`)}
          />
          <VictoryStack>
            <VictoryBar
              data={data2012}
              x="quarter"
              y="earnings"
            />
            <VictoryBar
              data={data2012}
              x="quarter"
              y="i"
            />
            <VictoryBar
              data={data2014}
              x="quarter"
              y="earnings"
            />
            <VictoryBar
              data={data2015}
              x="quarter"
              y="earnings"
            />
          </VictoryStack>
        </VictoryChart>
      )
    }
  }

//   ReactDOM.render(<Test/>, mountNode);

  export default Test;
